 Name: compareWithDelta
 ID: 36
 DataType: method
 RandomSeed: 160
 Value: |+1
  param x,y,delta:any->boolean
  
  var dataTypeStr:string
  
  dataTypeStr := getSimTalkTypename(x)
  if dataTypeStr /= getSimTalkTypename(y) 
  	return false
  end
  
  switch dataTypeStr
  case "boolean","string" 
  	return (x=y)
  else
  	return (abs(x-y) < delta/2)
  end
  

